          field_text:
            -
              value: "<drupal-entity data-align=\"center\" data-embed-button=\"media\" data-entity-embed-display=\"view_mode:media.full\" data-entity-type=\"media\" data-entity-uuid=\"048d997a-952f-401c-a25f-61719909f94a\" data-langcode=\"fr\"></drupal-entity>\r\n\r\n<p>Ma chambre a la forme d'une cage<br />\r\nLe soleil passe son bras par la fenêtre<br />\r\nLes chasseurs à ma porte<br />\r\nComme les petits soldats<br />\r\nQui veulent me prendre</p>\r\n\r\n<blockquote>\r\n<p>Je ne veux pas travailler<br />\r\nJe ne veux pas déjeuner<br />\r\nJe veux seulement l'oublier<br />\r\nEt puis je fume</p>\r\n</blockquote>\r\n\r\n<p>Déjà j'ai connu le parfum de l'amour<br />\r\nUn million de roses n'embaumerait pas autant<br />\r\nMaintenant une seule fleur dans mes entourages<br />\r\nMe rend malade</p>\r\n\r\n<blockquote>\r\n<p>Je ne veux pas travailler<br />\r\nJe ne veux pas déjeuner<br />\r\nJe veux seulement l'oublier<br />\r\nEt puis je fume</p>\r\n</blockquote>\r\n\r\n<p>Je ne suis pas fière de ça<br />\r\nVie qui veut me tuer<br />\r\nC'est magnifique être sympathique<br />\r\nMais je n'le connais jamais</p>\r\n"
              format: full_html
